import React from "react";

export default function InfoPokemonsCaptured() {
  return (
    <div>
      <li onClick={(pokemon, pos) => hadlerInfoCaptured(pokemon, pos)}>
        {pos} - {pokemon.name}
      </li>
    </div>
  );
}
